import city from '../../city.svg'
import catpic from '../../cat.svg'
import catest from '../../catest.svg'
import './cat.css';
function Cat(){
    /*<div className='absolute top-2 left-2  w-[100px] h-[400px]  p-2'>
    <img className='  scale-[2.3]' src={catpic} alt="React Logo" />
    </div>*/
    return (
        <div className='text-white h-screen overflow-hidden'>
            <div className='bg-gradient-to-b from-cyan-800 via-black to-cyan-800 w-full h-64 relative'>
                <div className='w-full absolute bottom-0 '>
                    <div className='bg-repeat  h-64 mx-12 animate-cityAnimation' style = {{ backgroundImage: `url(${city})` }}></div>
                </div>

                <div className='w-full overflow-hidden max-w-[950px] absolute bottom-[200px] left-[120px]'>
                    <div className='bg-no-repeat h-[900px] w-[2200px] animate-catAnimation bg-slate-100 ' style = {{ backgroundImage: `url(${catest})` }}></div>

                </div>






            </div>




        </div>
    )
}
export default Cat;
